import Login from "./Login";

var isLoggedIn = false;

function App() {
  return (
    <div className="container">{ () => {

      if (isLoggedIn) {
        return <h1>Hello</h1>
      } else {
        return (
          <Login />
        )
      }

    }}</div>
  );
}

export default App;
